    "preGame": "Step right up, ladies and gentlemen, ghosts and ghouls! It‚Äôs a swell evening for some Tuesday Night Trollball! I‚Äôm Nok the Corrupter, and boy howdy, do we have a doozy for you! We‚Äôre coming to you live from the Sun-Baked Bowl, where the clay is hot enough to fry a cockatrice egg and the 'stands' are just blankets on the dunes! It‚Äôs the home-town Desert Spectres taking on my personal favorites‚Äîthe meanest, toughest bunch of beauties in Osterra‚Äîthe Ebon Gate Corruptors! üèüÔ∏èüî•\n\nNow, let‚Äôs talk about those Corruptors! I saw Smith Syst in the locker room earlier, and she was doing her usual thing, daring a teammate to eat a live worm! That‚Äôs the kind of grit you love to see, folks! Meanwhile, Bullion Iglesias was sitting in the corner like a statue, just meditating away. You can feel the focus! They‚Äôre looking to give those Spectres a real run for their money, and with Ellette Paz and her blackjack ready to go, I wouldn't want to be on the receiving end of that defense! ü™±üî®\n\nOn the other side of the field, the Desert Spectres are looking sharp‚Äîor at least half of them are! Angelita Darce has shaved exactly half of his mustache for this big game. It‚Äôs a bold look, folks, almost as bold as their boss, that ol' frenemy Geth the Gravelord! And keep an eye on Steve; she‚Äôs already got a betting pool going. I‚Äôd put my soul on the Corruptors, but then again, my boss Lord Orzalon might have something to say about that! Let‚Äôs get ready for some carnage! üåµüé≤",
    "postGame": "Holy smokes, what a humdinger of a match! The Ebon Gate Corruptors have pulled off a victory that would make even the grumpiest demon crack a smile! We started things off right after halftime with a frantic scramble in Center Field. Ellette Paz snatched up the troll head like it was a bag of gold, but the Spectres' defense was stickier than a spider's web! Judi Carrington tried to make a break for it twice, but those desert dwellers weren't budging! üèàüí•\n\nThings got spicy when Amedeo Bari tried to take a couple of long shots from Center Field. He missed the basket, sure, but the ambition was enough to give me goosebumps! The ball kept changing hands like a hot potato, and the tension was thicker than the mud at the Sinking Field. You could tell both teams were itching for a little of the old ultra-violence, and boy, did they deliver! üëè‚ú®\n\nThen came the first big crack of the night! Shelman McQuoid of the Spectres decided Bullion Iglesias had been standing for too long and sent him straight to the infirmary! A real bell-ringer, folks! It looked like the Corruptors were in trouble when Amedeo Bari fumbled a pass to Simsar Carrelli, leaving the ball ripe for the picking. Bahr Ethelstan was there to scoop it up, much to the delight of the home crowd. ü§ïüöë\n\nBut you can't keep a good Corruptor down! Ellette Paz decided it was time for some payback and absolutely leveled Heyes Iver! I haven't seen a hit like that since Sir Artorias tried to take on a mountain giant! The field was turning into a real scrap-heap. Not to be outdone, Muscolo Jaehne took out our very own Smith Syst, sending her to see Terle Chenay for some quick mending. It was a revolving door of pain! üî®üí¢\n\nAs the game wore on, the Spectres tried to make their move. Eileen Mikihisa and Steve were darting toward the goal like thirsty camels toward an oasis, but the Corruptors' defense, led by Olnek Vizzone and Simsar Carrelli, held firm! Even with the intense heat of the desert sun beating down, our boys didn't break a sweat‚Äîmostly because they were too busy throwing shoulders! üåµüèÉ‚Äç‚ôÇÔ∏è\n\nWe headed into Overtime with a goose-egg on the scoreboard, but the energy was electric! Both teams took a quick breather, and the healers were working overtime. Terle Chenay had Bullion and Smith back on their feet in no time, proving that Ebon Gate dental plans are second to none! The Spectres' Verlee Dacia was just as busy, patching up Heyes Iver for more punishment. ‚è∞‚ö°\n\nOvertime was a total free-for-all! Lovash Marius started things off by injuring Ellette Paz, but Smith Syst came back with a vengeance! She didn't just play the game; she dismantled the Spectres! She took out Heyes Iver again, then sent Bahr Ethelstan packing, and finally finished her rampage by injuring Lovash Marius! It was a masterclass in brutality that would make Geth the Gravelord weep into his gravel! üòàüíÄ\n\nIn the midst of all that carnage, Steve managed to catch Bullion Iglesias off guard and sent him back to the sidelines. It was back and forth, hit for hit, a real test of who wanted that leather head more! The Spectres were looking to end it when Angelita Darce tried a wild pass, but oh boy, did he choose the wrong target! Olnek Vizzone read that play like a book and snatched the ball right out of the air! INTERCEPTION! üèàüëê\n\nWith the ball back in the Corruptors' hands, the momentum shifted for good. Olnek Vizzone charged forward, and while the Spectres tried to stop him, they were gassed! Smith Syst was still out there playing like a woman possessed, keeping the defense occupied. The Spectres were looking as confused as Sir Randy trying to find his way out of a paper bag! üìúü§î\n\nThen came the moment of glory! Simsar Carrelli found himself with an opening in the Away Field. He didn't hesitate, he didn't blink‚Äîhe let that troll head fly! SWISH! A two-point shoot right into the basket! The Ebon Gate Corruptors take it 2 to 0 in a stunning display of skill and savagery! What a night for the fans of the Gate! Until next week, this is Nok the Corrupter saying: keep your weapons sharp and your healers closer! Goodnight, Osterra! üèÜüéâ",
