    "preGame": "Step right up, ladies and gentle-ghouls! üèüÔ∏è It is a glorious Tuesday night in the Everwar, and we are live from the stone-cold ramparts of the Stronghold Bailey! I am your announcer, Nok the Corrupter, and holy smokes, do we have a humdinger for you tonight! The New Ravenfall Commanders are playing host to the New Monteforte Chaos Creatures in a match that promises more bone-cracking than a giant's breakfast! ü¶¥ \n\nI was down on the field earlier, and the pre-game energy is more infectious than a plague from Brennen Farno! I saw the Commanders' very own Jozef Pepe winning a belching contest that nearly shook the cobblestones loose‚Äînow that is what I call civic engagement! On the other side of the pitch, Wolbrom Ariella is currently singing a sea shanty so terribly out of tune it might actually be a new form of psychological warfare. üé∂ I love it! \n\nLook at the focus on Boulanger Procto as he meticulously arranges his gear in a perfect spiral‚Äîaesthetic and deadly! Meanwhile, Alben Diantha is dipping his hands in ice-cold well water, preparing to deliver some frosty hammers to the opposition's teeth! üî® Whether you are here for the White Ravens or the Eponore faction, we can all agree that seeing blood on these castle stones is the best way to spend a Tuesday! Keep your eyes peeled for Sir Tanos on the ramparts; I hear he‚Äôs looking for someone to stab, and golly, I hope it isn't me! Let's get to the action! üõ°Ô∏è",
    "postGame": "What a spectacular display of organized mayhem, folks! üèüÔ∏è The Commanders have defended their castle with a final score of 5 to 3 in a game that went the distance and then some! If you like your sports with a side of internal bleeding, this was the match of the century! \n\nThe game got off to a frantic start when Jozef Pepe scooped up the troll head, but the real fireworks began when Tucker Hett pulled off a magnificent interception from Moir Sass! It was a steal so clean it would make Dima the shadow king blush with envy! üåë \n\nThe violence was absolutely top-shelf tonight. Theis Loredo delivered a tackle on Urata Oriana that sounded like a sack of claymores falling down a flight of stairs! ‚öîÔ∏è Urata was sent to the sidelines early, but thanks to the miracle of the Everwar and the hard work of healer Lian Denton, they were back in the fray before the blood even dried! \n\nWe saw Raouf Dragone make a valiant run, darting through the defense like a rogue escaping Sawyer‚Äôs circus, but Estes Adrian brought him down with a crunch that echoed off the castle walls! üè∞ That is the kind of commitment to the tackle that makes this demon's heart sing! \n\nThen came the moment for the Chaos Creatures! Gabriele Klehm didn't just find the end zone; she practically waltzed through the Commanders' line and dunked that troll head right into the goal! üèÄ A touchdown for the ages that had Dame Terra Monteforte cheering from the sidelines! \n\nBut we couldn't settle this in regulation, oh no! We headed into Overtime, where the real grit comes out! ‚è≥ Every broken bone was reset, and the players returned to the field hungrier for victory than a werewolf in King Nezmear‚Äôs kennel! \n\nIn the overtime heat, Jessalin Zobias became a one-person wrecking crew! He delivered back-to-back tackles that sent Mouldon Earl and Fogel Raynold straight to the dirt! ü™µ Poor Fogel looked like he‚Äôd been hit by a falling portcullis, and the Chaos Creatures' momentum was halted by the sheer brutality of it! \n\nThe Chaos Creatures tried to rally, with Alben Diantha and Urata Oriana making desperate runs, but the Commanders' defense held firmer than a door in Sir Garon Ironrock‚Äôs house! üö™ A wild pass from Procto was snatched away by Dusa Curson, ending any hope of a Monteforte miracle! \n\nFinally, the play that will be talked about in every tavern from here to the Demon Prison! Theis Loredo, after a night of devastating hits, decided to end it with a flourish. From all the way back in the Home Field, she lined up a shot and sent that leather head sailing through the air! ‚òÑÔ∏è \n\nSWISH! A two-point shot from distance to clinch the 5-3 victory for the Commanders! üéØ Truly a finish that would make Geth the Gravelord weep with joy! Take that, you Haven Lights bores‚Äîthis is how real athletes play! Now, if someone could help me avoid Sir Tanos on the way to the exit, I'd appreciate it! Goodnight, Osterra! üåô",
