    "preGame": "### üéôÔ∏è TUESDAY NIGHT TROLLBALL LIVE FROM THE STARLIGHT LAGOON! üéôÔ∏è\\n\\nGreetings, ghouls, ghosts, and glorious gladiators of Osterra! It is a marvelous Tuesday night for some Trollball! We‚Äôre coming to you live from the Prismatic Pavilion, perched precariously over the Starlight Lagoon, where the water is blue and the bruises are purple! Today‚Äôs matchup features the wealth-worshipping **New Prosperity Profits** visiting the chaotic carnival known as the **Starlight Bazaar Bizarres**! I can smell the profit and the greasepaint from the announcer's booth!\\n\\nLook at those Profits preparing for the slaughter! **Boleslaw Heathcote** is currently inhaling the fumes of burning parchment‚Äînothing like a little light arson to get the blood pumping! And there‚Äôs **Yoshi Cathy**, folks, devouring a raw onion like it‚Äôs a sweet summer peach. That‚Äôs the kind of intestinal fortitude that makes a demon weep with joy! They‚Äôre backed by the Guild of the Black Sky, and I‚Äôm sure that strangely beautiful kissless virgin Brennen Farno has a heavy wager on this one. If only he‚Äôd spend less time being a money priest and more time enjoying a good old-fashioned evisceration!\\n\\nBut don‚Äôt count out our hosts, the Bizarres! Kython‚Äôs crew is out in force today, and I see **Quintessa Austine** trying to get a slow clap going with an audience that‚Äôs more interested in the concessions than the combat! **Gagliano Tallbott** is currently telling a joke to the troll head‚Äîlet's hope the ball finds it funny, or it might just slip right through his fingers! It‚Äôs going to be a real humdinger of a game, so grab your spiked refreshments and settle in for the violence! üçøüëπ",
    "postGame": "### üèüÔ∏è THE VERDICT IS IN: PROFIT MARGINS AND BROKEN BONES! üèüÔ∏è\\n\\nWhat a magnificent display of mayhem we‚Äôve witnessed here at the Pavilion! The **New Prosperity Profits** have walked away with a hard-fought **1 to 0 victory** over the **Starlight Bazaar Bizarres**! It was a defensive struggle for the ages, filled with more broken bones than a necromancer‚Äôs workshop! Truly a delight for the senses! üíÄ\\n\\nThe action started fast and furious in center field when **Yoshi Cathy** snatched up that beautiful leather head! But the Bizarres weren‚Äôt going to let the money-men walk all over them. We saw some spectacular blocking early on, with **Pulchi Benyamin** and **Pellikka Concettina** standing their ground like iron walls against the charging Gagliano Tallbott! Say, those Profits really know how to protect their assets!\\n\\nThe first real taste of Oesterran hospitality came when **Pulchi Benyamin** absolutely leveled **Milo Nelie**! It was a gorgeous tackle that sent Milo straight to the dirt! That‚Äôs what I call a blue-ribbon collision, folks! You could hear the ribs snapping from the top row of the velvet-lined boxes where the bankers sit! üî®\\n\\nBut the Bizarres had some fight in them yet! **Gagliano Tallbott**, clearly not appreciating the 'joke' Pulchi played on his teammate, came back later and delivered a thumping tackle that left Pulchi seeing stars and singing soprano! It‚Äôs a good thing the Everwar keeps these folks coming back, because that was a hit that would‚Äôve ended a career in any other reality! \\n\\nThe second half was just as delicious! **Aggri Cookie** decided **Gladdie Farika** had stayed in the game too long and sent them packing with a tackle that would make Geth the Gravelord crack a smile! It was pure, unadulterated Trollball poetry in motion, and the crowd roared for the blood on the planks! ü©∏\\n\\nHowever, the turning point came when **Faina Hendrix** decided enough was enough! With the grace of a gazelle and the ferocity of a demon, Hendrix charged right into the End Zone and **DUNKS THE BALL INTO THE GOAL**! A one-point touchdown that felt like a ton of bricks falling on the Bizarres' hopes! What a play! Hendrix is a real crackerjack athlete! üèÄ\\n\\nThe Bizarres tried to rally, with **Willa Lois** delivering a bone-crunching tackle to **Aufmann Tedric**, but the Profit's defense held firm. Even an interception by **Melesa Zelten** late in the game wasn't enough to turn the tide against the financial juggernaut of New Prosperity! I suppose even the Prismatic Troupe can't juggle their way out of a solid defense!\\n\\nI have to say, seeing **Merissa Mathian** and **Essa Pattie** working overtime to scrape their players off the stage-planks was a real treat! Those healers are the unsung heroes of the game, even if they are keeping the fun from being permanent! It‚Äôs a shame the 'heroes' of the realm aren't here to see what real work looks like! üíâ\\n\\nIn the final moments, **Yoshi Cathy** reminded us why he‚Äôs a force to be reckoned with, taking out **Gagliano Tallbott** just for good measure! It‚Äôs that kind of spiteful, high-energy finish that keeps the fans coming back to the Starlight Lagoon week after week! Yoshi really finished that onion and finished the game!\\n\\nSo, as the sun sets over the pavilion, the New Prosperity Profits count their winnings and the Starlight Bazaar Bizarres lick their wounds! Another Tuesday night, another glorious chapter in the book of Trollball! I‚Äôm Nok the Corrupter, reminding you that life is short, but the Everwar is long, so hit 'em hard and hit 'em often! Goodnight, Osterra! üåôüî•",
