    "preGame": "### üéôÔ∏è STEP RIGHT UP, SPORTS FANS! IT'S TUESDAY NIGHT TROLLBALL! üéôÔ∏è\n\nHello, Osterra! This is Nok the Corrupter, coming to you live and loud from the sparkling‚Äîand frankly, nauseatingly clean‚ÄîBuccaneer's Bowl on Toast Island! Oh, look at that pristine turf! It‚Äôs almost a shame we‚Äôre about to soak it in sweat and ichor, isn't it? Hahaha! My old pals Morgwae and Artorias really did me a favor letting me out of that gloomy Demon Prison; who knew the fresh air of a resort could smell so much like impending violence? \n\nTonight, we have a real humdinger of a match-up! The **Zmeigorod Snessengers** have slithered out of the swamp to face off against the **The Tortell Privateers**! It‚Äôs a clash of cultures, folks! On one side, we‚Äôve got the Snessengers, led by Waldon Tadeo who is currently‚ÄîI kid you not‚Äîrubbing a foul-smelling mushroom on their elbows. Whatever works for flexibility, right? Over in the Privateers' dugout, Dib Tufts is chugging a raw egg, shell and all! That‚Äôs the kind of grit that makes this game the greatest spectacle in the Everwar! ü•öüí•\n\nBut hold onto your hats, because tonight is an **OPEN BAR** night! üçª That‚Äôs right, the booze is flowing faster than the blood! I see Elspeth Ortell over there, probably brewing up some of her famous ritual sangria to keep the 'festivities' going. Even that literacy-spreading pest Cinnemon is here, though I hope someone tackles him into the puppet kraken! We‚Äôre expecting hits so hard they‚Äôll knock the memories right out of these adventurers before they even hit the regeneration cycle! Let‚Äôs get ready for some TROLLBALL! ‚öæüëπ",
    "postGame": "### üèüÔ∏è THE DUST SETTLES ON TOAST ISLAND: A BOOZY BLOODBATH! üèüÔ∏è\n\nGreat ghouls and ghosts, what a spectacle! The Zmeigorod Snessengers have absolutely dismantled the Tortell Privateers with a final score of **5 to 1**! It wasn't just a game; it was a drunken demolition derby! I haven't seen this much stumbling since Sir Tanos tried to read a map! Hahaha! The Privateers might have the fancy resort and the pristine turf, but the Snessengers brought the swamp-bred savagery and a much higher tolerance for the open bar! üêçüî•\n\nThe carnage started early when Arni Griffith snagged the ball in Center Field, but the Privateers weren't playing nice. Kidder Starkey absolutely leveled Delija Dowling, sending him to the healer before the first whistle had even cooled! But the Snessengers wouldn't be denied. Kleinstein MacGregor‚Äîafter clapping a prime number of times, mind you‚Äîunleashed a thunderous shot from Home Field to put Zmeigorod on the board! The crowd went wild, and the players went straight for the kegs! üç∫üí®\n\nAs the alcohol started to kick in, the plays got... well, let's call them 'creative.' Payson Jan was a one-man wrecking crew, injuring both Kleinstein MacGregor and Rose Kluge in rapid succession! But Arni Griffith, despite being three sheets to the wind, managed to sink another beautiful shot from Home Field! By the time halftime rolled around, half the field was seeing double, and I‚Äôm pretty sure I saw Evalyn Pierrepont trying to polish his helmet with a snail that had already passed out from the fumes! üêåü•¥\n\nThe second half was pure, unadulterated chaos. Castorina Gies gave the home crowd something to cheer about, drunkenly stumbling into the End Zone for the Privateers' lone goal! It was a beautiful, wobbling display of athleticism that surely made Elspeth Ortell proud. But the Snessengers' Dare Wynnie answered back with a dunk that was so forceful, I think the puppet kraken in the bay actually flinched! Zmeigorod was simply too much for the resort-dwellers to handle. ü¶ëüèÄ\n\nSpeaking of the Privateers, their coordination fell apart faster than a peace treaty signed by Sir Randy. Lilithe Royce intercepted a wild pass from Delija Dowling, only to have the ball dropped moments later by a very intoxicated Ellan Elburt. It was like watching a group of newborn fawns trying to play rugby in a brewery! Even the 'heroes' in the stands looked embarrassed. I saw Imra, the Master of Elixirs, taking notes‚Äîprobably on how NOT to mix sports and spirits! üß™üç∑\n\nThe injuries continued to pile up like bodies in a Geth funeral pyre. Loralee Sunny sent Arni Griffith to the sidelines with a brutal tackle, but it was too little, too late. The Snessengers' defense, though swaying slightly, held firm. Avaria Revell and Evalyn Pierrepont were throwing passes that looked more like desperate heaves, yet they kept the pressure on. The Privateers' luck had simply run dry, much like the first three kegs at the sideline bar! üíÄüçª\n\nIn a hilarious turn of events, Gere Cordelie spent most of the fourth quarter stumbling around 'DRUNK' according to my charts, yet still managed to lead the charge! The Snessengers' Dare Wynnie put the final nail in the coffin with another spectacular dunk in the End Zone. By that point, Payson Jan was literally stumbling around the field, probably looking for a place to nap rather than a ball to tackle. It was a glorious, messy, wonderful disaster! üéäü§ï\n\nYou have to love the irony, folks! The Privateers, backed by the wealthy interests of Cedar Hill, couldn't buy a win against the swamp-dwellers. Maybe they should spend less time on 'secret hand signals' and more time practicing how to walk in a straight line after four ales! I bet Sir Artorias is somewhere 'Moonslaying' his way through a bottle of wine just to forget this performance. At least Eugen Zacks stayed busy at the healer's tent; that man earns every copper! üí∞ü©π\n\nSo, there you have it! The Zmeigorod Snessengers take home the glory, the points, and probably most of the remaining booze! They showed us that a little mushroom on the elbows and a heroic backstory for a troll head goes a long way. The Tortell Privateers? Well, they'll have plenty of time to nurse their hangovers and their bruised egos on the beach tomorrow. Just watch out for the resort security, boys! üèùÔ∏èü§Æ\n\nThis is Nok the Corrupter, signing off from the Buccaneer's Bowl! What a night for Trollball! We had goals, we had gore, and we had a record-breaking amount of liver damage! Join us next week for more Tuesday Night Trollball, where the hits are hard, the heroes are mocked, and the action never stays dead! Stay brutal, Osterra! üéôÔ∏èüëπü§ò",
